class Stsize extends React.Component {
    changeSize = (value) => {
        this.props.state
    }

    render() {
        return (
            <>
                <div>
                    <h1>Size:12px</h1>
                    <button onClick={() => this.changeSize(-2)} type="button" className="btn btn-success btn-lg">giảm</button>
                    <button onClick={() => this.changeSize(+2)} type="button" className="btn btn-success btn-lg">Tăng</button>
                </div>
            </>
        );
    }

}

export default Stsize;
